import React, { useState, useEffect } from "react";
import "./Home.css";

const Home = () => {
  // Replace this with actual database fetching logic later
  const fetchEvents = () => {
    return [
      {
        id: 1,
        title: "Senior UI Developer",
        rate: "$120/hr",
        company: "Nike",
        logo: "https://logo.clearbit.com/nike.com",
      },
      {
        id: 2,
        title: "Senior Backend Engineer",
        rate: "$150/hr",
        company: "Google",
        logo: "https://logo.clearbit.com/google.com",
      },
      {
        id: 3,
        title: "Azure Data Engineer",
        rate: "$125-145/hr",
        company: "Airbnb",
        logo: "https://logo.clearbit.com/airbnb.com",
      },
      {
        id: 4,
        title: "Frontend Developer",
        rate: "$110/hr",
        company: "Meta",
        logo: "https://logo.clearbit.com/meta.com",
      },
      {
        id: 5,
        title: "DevOps Engineer",
        rate: "$130/hr",
        company: "Amazon",
        logo: "https://logo.clearbit.com/amazon.com",
      },
      {
        id: 6,
        title: "Cloud Architect",
        rate: "$160/hr",
        company: "Microsoft",
        logo: "https://logo.clearbit.com/microsoft.com",
      },
    ];
  };

  const [events, setEvents] = useState([]);

  useEffect(() => {
    setEvents(fetchEvents());
  }, []);

  return (
    <div className="home">
      {/* Navigation Bar */}
      <nav className="navbar">
        <div className="nav-left">
          <a href="#">Home</a>
          <a href="#">About</a>
          <a href="#">Contact Us</a>
        </div>
        <div className="nav-right">
          <a href="#" onClick={() => window.location.reload()} className="profile-btn">
            Profile
          </a>
        </div>
      </nav>

      {/* Events Grid */}
      <div className="events-container">
        {events.map((event) => (
          <div className="event-card" key={event.id}>
            <div className="event-header">
              <p className="event-rate">{event.rate}</p>
              <button className="bookmark-btn">ðŸ”–</button>
            </div>
            <h3 className="event-title">{event.title}</h3>
            <div className="event-footer">
              <img src={event.logo} alt={`${event.company} logo`} className="event-logo" />
              <p className="event-company">{event.company}</p>
              <button className="view-btn">View</button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Home;
